import React from 'react';
import NavigationBar from '../components/NavigationBar';

const RegisteredPage = () => {
    return(
        <div>
            <NavigationBar />
          <br/>  <h1> Thanks for Registering! </h1> <br/>
          <p> We have sent you an email. Please verify your email in order to complete setting up your account. </p>
          <p> If you have not received the verification email, please check your Spam folder </p>

        </div>

    );
};

export default RegisteredPage;
